import React from 'react';
import './master.css';


class Equipo extends React.Component {

render() { 
  console.log(this.props.equipo);
  return (  
             <div className="tableEquipos">
	      <div className="row">
	      <span className="cell bandera"><img src={this.props.equipo.bandera}/></span>
	      <span className="cell"><div className="tableIntegrantes"><div className="row"><span className="cell"><p className="map-title">INTEGRANTES</p></span></div>
	  { this.props.equipo.integrantes.map((integrante) => {
		  return <div className="row">
	             <span className="cell integrante">{integrante.nombre}</span></div>
	         })
	  }
	    </div> </span>
	      </div>
	      <div className="row">
	      <span className="cell nombreEquipo"><img src="/images/linea1.png"/></span></div>
	      <div className="row">
	      <span className="cell nombreEquipo"><p className="map-title">{this.props.equipo.nombre}</p></span></div> 
	      </div>

  )

}     

}

export default Equipo;
